import { slideInUp,zoomIn } from 'react-animations';
import Radium from 'radium';
export default {
	slideInUp: {
    animation: '0.5s linear',
    animationName: Radium.keyframes(slideInUp, 'slideInUp')
  },
  zoomIn:{
    animation: '0.5s linear',
    animationName: Radium.keyframes(zoomIn, 'zoomIn')
  }
}
